DX = [-1,-1,-1,0,0,1,1,1]
DY = [-1,0,1,-1,1,-1,0,1]

def step(cells):
    near = set()
    for cell in cells:
        x = cell[0]
        y = cell[1]
        near.add((x, y))
        for i in range(8):
            near.add((x + DX[i], y + DY[i]))
    
    next_cells = set()
    for cell in near:
        x = cell[0]
        y = cell[1]
        neighbors = 0
        for i in range(8):
            if (x + DX[i], y + DY[i]) in cells:
                neighbors += 1
        if (x, y) in cells:
            if neighbors == 2 or neighbors == 3:
                next_cells.add((x,y))
        elif neighbors == 3:
            next_cells.add((x, y))
    return next_cells

for i in range(1000):
    cells = step(cells)
